import React from 'react';

// In Navbar, we can assign a style from an object by using curly braces
function Navbar() {
  return (
    <div className='card'>
      <div className='card-header' id='about-me'><div>About Me</div></div>
      <div className='card-header' id='portfolio'>Portfolio</div>
    </div>
  );
}

export default Navbar;
